configure:
  commands:
    end:
      new_state: execute
    ip prefix-list bgp_prefix seq 1 deny 7.7.7.0/24 ge 32: "ip prefix-list bgp_prefix\
      \ seq 1 deny 7.7.7.0/24 ge 32\r\n"
    line console 0:
      new_state: configure_line
    no logging console: ''
  prompt: 9300-24UX-1(config)#
configure_line:
  commands:
    end:
      new_state: execute
    exec-timeout 0: ''
  prompt: 9300-24UX-1(config-line)#
connect:
  commands:
    ? ''
    : new_state: execute
  preface: 'Trying mock_device ...

    Connected to mock_device.

    Escape character is ''^]''.'
  prompt: ''
execute:
  commands:
    config term:
      new_state: configure
    config-transaction:
      new_state: configure
    show version: ''
    term length 0: ''
    term width 0: ''
  prompt: 9300-24UX-1#
